export const initialState = {
    mainPosts: [{
        id: 1,
        User: {
            id: 1,
            nickname: '개밍두',
        },
        content: '첫번째 게시글 #해시태그'
    }],
};

const reducer = (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

export default reducer;
